import logo from './logo.svg';
import './App.css';
import React from 'react';
import NavBar from './NavBar'

class App extends React.Component {

    constructor(props) {
        super(props)
    }


    loadEvents = async (e) => {
        const httpResponse = await fetch("https://eonet.gsfc.nasa.gov/api/v3/status=open")
        const events = await httpResponse.json()
        console.log(events)
    }

    render() {

        return (
            <div className="container-fluid p-0">
                <NavBar onClickLoadAll={this.loadEvents} />
            </div>

        )
    }

}
export default App;
